{"command": "write", "path": "/blog/index.html", "content": "<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>My Simple Blog</title>
    <style>
        body {
            font-family: Arial, sans-serif;
            line-height: 1.6;
            max-width: 800px;
            margin: 0 auto;
            padding: 20px;
            color: #333;
        }
        header {
            text-align: center;
            margin-bottom: 30px;
            border-bottom: 2px solid #333;
            padding-bottom: 20px;
        }
        h1 {
            color: #2c3e50;
        }
        .post {
            margin-bottom: 40px;
            padding: 20px;
            border: 1px solid #ddd;
            border-radius: 5px;
            background: #f9f9f9;
        }
        .post h2 {
            color: #3498db;
            margin-top: 0;
        }
        .post-meta {
            color: #7f8c8d;
            font-size: 0.9em;
            margin-bottom: 10px;
        }
        .post-content {
            margin-bottom: 15px;
        }
        footer {
            text-align: center;
            margin-top: 40px;
            padding-top: 20px;
            border-top: 2px solid #333;
            color: #7f8c8d;
        }
    </style>
</head>
<body>
    <header>
        <h1>My Simple Blog</h1>
        <p>A blog about technology, life, and everything in between</p>
    </header>

    <main>
        <article class="post">
            <h2>Welcome to My Blog</h2>
            <div class="post-meta">Posted on January 15, 2024 by Admin</div>
            <div class="post-content">
                <p>Hello and welcome to my new blog! I'm excited to share my thoughts, experiences, and insights with you all. This is just the beginning of what I hope will be a wonderful journey of sharing knowledge and connecting with readers.</p>
                <p>This blog is built with pure HTML - no frameworks, no JavaScript, just clean and simple markup. Sometimes going back to basics is the best approach!</p>
            </div>
        </article>

        <article class="post">
            <h2>Why I Love Simple Web Design</h2>
            <div class="post-meta">Posted on January 10, 2024 by Admin</div>
            <div class="post-content">
                <p>In today's world of complex frameworks and heavy JavaScript applications, there's something beautiful about simple, static HTML websites. They load fast, are accessible to everyone, and are much easier to maintain.</p>
                <p>By focusing on clean HTML and minimal CSS, we can create websites that work on any device, any browser, and provide a great user experience without unnecessary bloat.</p>
            </div>
        </article>

        <article class="post">
            <h2>Getting Started with Blogging</h2>
            <div class="post-meta">Posted on January 5, 2024 by Admin</div>
            <div class="post-content">
                <p>If you're thinking about starting a blog, my advice is to just start! Don't overthink the technology or the perfect design. Focus on your content and your voice. You can always improve the technical aspects later.</p>
                <p>What matters most is consistency and authenticity. Share what you know, what you're learning, and what you're passionate about. Your readers will appreciate your honesty and dedication.</p>
            </div>
        </article>
    </main>

    <footer>
        <p>&copy; 2024 My Simple Blog. All rights reserved.</p>
        <p>Built with HTML only - keeping it simple and fast!</p>
    </footer>
</body>
</html>"}
